CREATE TABLE `cardcz` (
  `id` mediumint(8) NOT NULL auto_increment,
  `cardid` varchar(50) NOT NULL COMMENT '卡ID',
  `amount` double(15,2) default '0.00',
  `cdate` int(10) NOT NULL COMMENT '交易日期',
  `ctype` tinyint(1) NOT NULL default '0' COMMENT '操作类型 0为现金充值 1为POS刷卡充值',
