  `bankadder` varchar(100) default NULL COMMENT '开户行地址',
  `bankusername` varchar(50) default NULL COMMENT '开户人',
  `balance` double(15,2) default '0.00',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1315 DEFAULT CHARSET=utf8;

