/*Table structure for table `cardtx` */

DROP TABLE IF EXISTS `cardtx`;

CREATE TABLE `cardtx` (
  `id` mediumint(8) NOT NULL auto_increment,
  `cardid` varchar(50) NOT NULL COMMENT '会员卡ID',
  `amount` double(15,2) default '0.00',
  `cdate` int(10) NOT NULL COMMENT '交易日期',
  `ctype` tinyint(1) NOT NULL default '0' COMMENT '操作类型，0现金提现，1为银行卡转账',
  `txt` varchar(200) default NULL COMMENT '备注',
  `bankno` varchar(30) default NULL COMMENT '银行流水号',
  `uid` mediumint(8) default NULL COMMENT '经办人',
  `balance` double(15,2) default '0.00',
  `bankname` varchar(50) default NULL COMMENT '转入行名称',
  `bankusername` varchar(50) default NULL COMMENT '开户行名称',
  `bankcard` varchar(50) default NULL COMMENT '转入银行卡号',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1347 DEFAULT CHARSET=utf8;

