/*Table structure for table `channel` */

DROP TABLE IF EXISTS `channel`;

CREATE TABLE `channel` (
  `id` int(8) NOT NULL auto_increment,
  `companyname` varchar(200) NOT NULL COMMENT '客户公司名称',
  `license` varchar(50) default NULL COMMENT '营业执照',
  `Contact` varchar(50) default NULL COMMENT '联系人',
  `tel` varchar(20) default NULL COMMENT '公司电话',
  `stat` tinyint(1) default '1' COMMENT '状态，1为正常，0为锁定',
  `cdate` int(10) NOT NULL COMMENT '建立时间',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `channel` */

LOCK TABLES `channel` WRITE;

UNLOCK TABLES;

/*Table structure for table `customer` */

DROP TABLE IF EXISTS `customer`;

CREATE TABLE `customer` (
  `id` mediumint(8) NOT NULL auto_increment,
  `membername` varchar(200) NOT NULL COMMENT '客户名',
  `sex` tinyint(1) NOT NULL default '1' COMMENT '性别',
  `nation` varchar(15) NOT NULL default '汉' COMMENT '民族',
  `tel` varchar(22) NOT NULL COMMENT '联系电话',
  `idcard` varchar(18) NOT NULL COMMENT '身份证',
  `carddate` varchar(20) NOT NULL COMMENT '身份证有效期',
  `adduser` int(8) NOT NULL COMMENT '开卡员工ID',
  `amount` double(15,2) default '0.00',
  `adder` varchar(200) NOT NULL COMMENT '联系地址',
  `stat` tinyint(1) NOT NULL default '1' COMMENT '状态 1正常 2冻结 3注销',
  `cdate` int(10) NOT NULL COMMENT '建立日期',
  `ugroup` tinyint(1) NOT NULL default '0' COMMENT '0为农户 1为商户',
  `lasttime` int(10) default NULL COMMENT '商户最后登陆时间',
  `actdate` int(10) default NULL COMMENT '注销或者挂失操作时间,需三天后才能进行操作',
  `freezen` double(15,2) default '0.00',
  `storagenumber` mediumint(8) default NULL COMMENT '仓库号数id',
  `typeid` mediumint(8) default NULL COMMENT '仓库类型',
  UNIQUE KEY `id` (`id`),
  KEY `NewIndex1` (`idcard`)
) ENGINE=InnoDB AUTO_INCREMENT=173 DEFAULT CHARSET=utf8;

