  `name` varchar(20) collate utf8_bin NOT NULL COMMENT '类别名',
  `typelist` text collate utf8_bin NOT NULL COMMENT '业务权限列表',
  `isactive` tinyint(1) NOT NULL default '1' COMMENT '是否启用，0未启用，1启用',
  `isstorage` tinyint(1) NOT NULL default '0' COMMENT '是否有铺面或者冷库地址（一般只有冷库老板或者大棚老板才有地址）0无 1有',
  `cdate` int(10) NOT NULL COMMENT '创建时间',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='utf8_general_ci';

/*Data for the table `customergroup` */

LOCK TABLES `customergroup` WRITE;

insert  into `customergroup`(`id`,`name`,`typelist`,`isactive`,`isstorage`,`cdate`) values (1,'商户','1,',1,1,1431419267),(2,'农户','1,',1,0,1431419267);

UNLOCK TABLES;

/*Table structure for table `customerinfo` */

DROP TABLE IF EXISTS `customerinfo`;

CREATE TABLE `customerinfo` (
  `id` mediumint(8) NOT NULL auto_increment,
  `cid` mediumint(8) NOT NULL COMMENT '客户ID',
  `bankcard` varchar(30) default NULL COMMENT '客户银行卡号',
  `bankname` varchar(50) default NULL COMMENT '开户行',
  `bankadder` varchar(200) default NULL COMMENT '开户行所在地',
  `bankusername` varchar(50) default NULL COMMENT '银行户名',
  `useimg_path` varchar(250) default NULL COMMENT '用户头像',
  `cardimg_path` varchar(250) default NULL COMMENT '身份证头像正面',
  `cardimgt_path` varchar(250) default NULL COMMENT '身份证反面',
  `finger1` text COMMENT '指纹1',
  `finger2` text COMMENT '指纹2',
  `finger3` text COMMENT '指纹3',
  `relativesname` varchar(35) default NULL COMMENT '亲属姓名',
  `relativessex` tinyint(1) default '0' COMMENT '0是女1是男',
  `relationship` varchar(20) default NULL COMMENT '关系',
  `relationtem` varchar(20) default NULL COMMENT '亲属手机',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=146 DEFAULT CHARSET=utf8;

/*Data for the table `customerinfo` */

