/*Table structure for table `ecs_category` */

DROP TABLE IF EXISTS `ecs_category`;

CREATE TABLE `ecs_category` (
  `cat_id` smallint(5) unsigned NOT NULL auto_increment,
  `cat_name` varchar(90) NOT NULL default '',
  `parent_id` smallint(5) unsigned NOT NULL default '0',
  PRIMARY KEY  (`cat_id`),
  KEY `parent_id` (`parent_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='utf8_general_ci';

/*Data for the table `ecs_category` */

LOCK TABLES `ecs_category` WRITE;

UNLOCK TABLES;

/*Table structure for table `ecs_goods` */

DROP TABLE IF EXISTS `ecs_goods`;

CREATE TABLE `ecs_goods` (
  `goods_id` mediumint(8) unsigned NOT NULL auto_increment,
  `cat_id` smallint(5) unsigned NOT NULL default '0',
  `goods_sn` varchar(60) NOT NULL default '',
  `goods_name` varchar(120) NOT NULL default '',
  `goods_number` smallint(5) unsigned NOT NULL default '0',
  `goods_price` double(15,2) default '0.00',
  `goods_desc` text NOT NULL,
  `goods_img` varchar(255) NOT NULL default '',
  `add_time` int(10) unsigned NOT NULL default '0',
  `last_update` int(10) unsigned NOT NULL default '0',
  `suppliers_id` smallint(5) unsigned default '0',
  `is_active` tinyint(1) NOT NULL default '1',
  `unit` varchar(60) default '',
  PRIMARY KEY  (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `cat_id` (`cat_id`),
  KEY `last_update` (`last_update`),
  KEY `goods_number` (`goods_number`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='utf8_general_ci';

/*Data for the table `ecs_goods` */

LOCK TABLES `ecs_goods` WRITE;

UNLOCK TABLES;

/*Table structure for table `ecs_order_goods` */

DROP TABLE IF EXISTS `ecs_order_goods`;

CREATE TABLE `ecs_order_goods` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `order_id` mediumint(8) unsigned NOT NULL default '0',
  `goods_id` mediumint(8) unsigned NOT NULL default '0',
  `goods_number` smallint(5) unsigned NOT NULL default '1',
  `goods_price` double(15,2) default '0.00',
  PRIMARY KEY  (`id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='utf8_general_ci';

/*Data for the table `ecs_order_goods` */

LOCK TABLES `ecs_order_goods` WRITE;

UNLOCK TABLES;

/*Table structure for table `ecs_order_info` */

DROP TABLE IF EXISTS `ecs_order_info`;

CREATE TABLE `ecs_order_info` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `order_sn` varchar(20) NOT NULL default '',
  `noid` varchar(50) NOT NULL default '',
  `order_status` tinyint(1) unsigned NOT NULL default '0',
  `pay_status` tinyint(1) unsigned NOT NULL default '0',
  `add_time` int(10) NOT NULL default '0',
  `pay_time` int(10) NOT NULL default '0',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`noid`),
  KEY `order_status` (`order_status`),
  KEY `pay_status` (`pay_status`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='utf8_general_ci';

/*Data for the table `ecs_order_info` */

LOCK TABLES `ecs_order_info` WRITE;

UNLOCK TABLES;

/*Table structure for table `ecs_supplier` */

DROP TABLE IF EXISTS `ecs_supplier`;

CREATE TABLE `ecs_supplier` (
  `suppliers_id` int(11) NOT NULL auto_increment,
  `suppliers_name` varchar(64) default '' COMMENT '供应商名称',
  `tel` varchar(30) default '' COMMENT '电话',
  `mobile` varchar(50) default '' COMMENT '手机',
  `email` varchar(50) default '' COMMENT '邮箱',
  `address` varchar(120) default '' COMMENT '地址',
  `linkman` varchar(20) default '' COMMENT '联系人',
  `ctdate` int(11) default NULL COMMENT '创建时间',
  `mddate` int(11) default NULL COMMENT '修改时间',
  `is_check` varchar(1) default '1' COMMENT '是否停用标识 0为停用',
  `suppliers_desc` text COMMENT '备注',
  PRIMARY KEY  (`suppliers_id`),
  KEY `name` (`suppliers_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='utf8_general_ci';

/*Data for the table `ecs_supplier` */

LOCK TABLES `ecs_supplier` WRITE;

UNLOCK TABLES;

/*Table structure for table `goods` */

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `id` mediumint(8) NOT NULL auto_increment,
  `pname` varchar(120) NOT NULL COMMENT '商品名称',
  `pclass` int(8) NOT NULL COMMENT '分类ID',
  `unit` char(5) NOT NULL default 'kg' COMMENT '单位',
  `cdate` int(10) NOT NULL COMMENT '创建日期',
  `mdate` int(10) default NULL COMMENT '修改日期',
  `muid` mediumint(8) default NULL COMMENT '最后修改人ID',
  `goodssn` varchar(50) default NULL,
