/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `id` mediumint(8) NOT NULL auto_increment,
  `ordersn` varchar(20) NOT NULL COMMENT '订单编码',
  `cid` mediumint(8) default NULL COMMENT '是否指定冷库老板为执行者',
  `price` double(15,2) default '0.00',
  `cdate` int(10) NOT NULL COMMENT '订单生成日期',
  `pdate` int(10) NOT NULL COMMENT '预计完成日期',
  `uid` mediumint(8) NOT NULL COMMENT '订单生成者',
  `pstat` tinyint(1) NOT NULL default '0' COMMENT '订单是否采用竟价方式，0为指派，1为竟价，当为竟价时会在前端的交易平台显示',
  `ostat` tinyint(1) NOT NULL default '1' COMMENT '订单状态1为正常，0为关闭，2为完成',
  `cstat` tinyint(1) NOT NULL default '0' COMMENT '受指派冷库老板是否接受该订单0为未接受，1为接受',
  `hstat` tinyint(1) NOT NULL default '0' COMMENT '货款状态，0为未给商户钱，1为打款了',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

